import '../styles/cards.scss';
import Stories from './Stories';
import Card from './Card';

function Cards() {
    const commentsOne = [
        {
            user: "송재화",
            text: "와 대박",
            id: 1
        },
        {
            user: "이기수",
            text: "잘사냐",
            id: 2
        },
        {
            user: "김미송",
            text: "좋아요",
            id: 3
        },
        {
            user: "이성재",
            text: "와 레알ㅋ 대ㅋ박ㅋ",
            id: 4
        },
    ];

    return (
        <div className="cards">
            <Stories />
        </div>
    );
}

export default Cards;
